    24→    includeBreakdown: z.boolean().default(true).describe('Include category and payment method breakdown'),
    25→  });
    26→
    27→  requiresPermission = 'reports:read';
    28→
    29→  async execute(
    30→    params: z.infer<typeof this.parametersSchema>,
    31→    context: ToolExecutionContext
    32→  ): Promise<ToolExecutionResult> {
    33→    const startTime = Date.now();
    34→
    35→    try {
    36→      const supabase = createAdminClient();
    37→      const { startDate, endDate, groupBy, includeBreakdown } = params;
    38→
    39→      // Fetch all payments in date range
    40→      const { data: payments, error } = await supabase
    41→        .from('payments')
    42→        .select(`
    43→          id,
    44→          payment_date,
    45→          amount,
    46→          payment_status,
    47→          payment_method,
    48→          client_id,
    49→          customer_memberships(
    50→            membership_plans(
    51→              name,
    52→              category
    53→            )
    54→          )
    55→        `)
    56→        .eq('organization_id', context.organizationId)
    57→        .in('payment_status', ['paid_out', 'succeeded', 'confirmed'])
    58→        .gte('payment_date', startDate)
    59→        .lte('payment_date', endDate)
    60→        .order('payment_date', { ascending: true });
    61→
    62→      if (error) throw error;
    63→
    64→      // Group by period
    65→      const grouped = new Map<string, {
    66→        period: string;
    67→        revenue: number;
    68→        paymentCount: number;
    69→        uniqueCustomers: Set<string>;
    70→        avgTransactionSize: number;
    71→        paymentMethods: Map<string, number>;
    72→        categories: Map<string, number>;
    73→      }>();
    74→
    75→      payments?.forEach((payment) => {
    76→        const date = new Date(payment.payment_date);
    77→        let period: string;
    78→
    79→        switch (groupBy) {
    80→          case 'day':
    81→            period = date.toISOString().split('T')[0];
    82→            break;
    83→          case 'week':
    84→            const weekStart = new Date(date);
    85→            weekStart.setDate(date.getDate() - date.getDay());
    86→            period = weekStart.toISOString().split('T')[0];
    87→            break;
    88→          case 'month':
    89→            period = `${date.getFullYear()}-${String(date.getMonth() + 1).padStart(2, '0')}`;
    90→            break;
    91→          case 'year':
    92→            period = `${date.getFullYear()}`;
    93→            break;
    94→        }
    95→
    96→        if (!grouped.has(period)) {
    97→          grouped.set(period, {
    98→            period,
    99→            revenue: 0,
   100→            paymentCount: 0,
   101→            uniqueCustomers: new Set(),
   102→            avgTransactionSize: 0,
   103→            paymentMethods: new Map(),
   104→            categories: new Map(),
   105→          });
   106→        }
   107→
   108→        const group = grouped.get(period)!;
   109→        const amount = parseFloat(payment.amount as any) || 0;
   110→
   111→        group.revenue += amount;
   112→        group.paymentCount++;
   113→        if (payment.client_id) group.uniqueCustomers.add(payment.client_id);
   114→
   115→        // Track payment methods
   116→        const method = payment.payment_method || 'unknown';
   117→        group.paymentMethods.set(method, (group.paymentMethods.get(method) || 0) + amount);
   118→
   119→        // Track categories
   120→        const category = (payment.customer_memberships as any)?.membership_plans?.category || 'Uncategorized';
   121→        group.categories.set(category, (group.categories.get(category) || 0) + amount);
   122→      });
   123→
   124→      // Convert to array and calculate metrics
   125→      const periods = Array.from(grouped.values()).map(g => ({
   126→        period: g.period,
   127→        revenue: g.revenue,
   128→        paymentCount: g.paymentCount,
   129→        uniqueCustomers: g.uniqueCustomers.size,
   130→        avgTransactionSize: g.paymentCount > 0 ? g.revenue / g.paymentCount : 0,
   131→        paymentMethods: includeBreakdown ? Object.fromEntries(g.paymentMethods) : undefined,
   132→        categories: includeBreakdown ? Object.fromEntries(g.categories) : undefined,
   133→      }));
   134→
   135→      // Calculate trends
   136→      const totalRevenue = periods.reduce((sum, p) => sum + p.revenue, 0);
   137→      const avgPeriodRevenue = periods.length > 0 ? totalRevenue / periods.length : 0;
   138→      const growth = periods.length >= 2
   139→        ? ((periods[periods.length - 1].revenue - periods[0].revenue) / periods[0].revenue) * 100
   140→        : 0;
   141→
   142→      return {
