   173→export class GenerateChurnReportTool extends BaseTool {
   174→  id = 'generate_churn_report';
   175→  name = 'Generate Churn Report';
   176→  description = 'Analyze customer churn rate, identify churned customers, and calculate retention metrics';
   177→  category: 'analytics' = 'analytics';
   178→
   179→  parametersSchema = z.object({
   180→    startDate: z.string().describe('Start date in YYYY-MM-DD format'),
   181→    endDate: z.string().describe('End date in YYYY-MM-DD format'),
   182→    includeReasons: z.boolean().default(true).describe('Include churn reasons analysis'),
   183→  });
   184→
   185→  requiresPermission = 'reports:read';
   186→
   187→  async execute(
   188→    params: z.infer<typeof this.parametersSchema>,
   189→    context: ToolExecutionContext
   190→  ): Promise<ToolExecutionResult> {
   191→    const startTime = Date.now();
   192→
   193→    try {
   194→      const supabase = createAdminClient();
   195→      const { startDate, endDate } = params;
   196→
   197→      // Get all memberships in period
   198→      const { data: memberships, error } = await supabase
   199→        .from('customer_memberships')
   200→        .select(`
   201→          id,
   202→          client_id,
   203→          status,
   204→          start_date,
   205→          end_date,
   206→          cancelled_at,
   207→          cancellation_reason,
   208→          membership_plans(name, category)
   209→        `)
   210→        .eq('organization_id', context.organizationId)
   211→        .or(`start_date.gte.${startDate},end_date.gte.${startDate}`)
   212→        .lte('start_date', endDate);
   213→
   214→      if (error) throw error;
   215→
   216→      // Calculate churn metrics
   217→      const activeAtStart = memberships?.filter(m =>
   218→        new Date(m.start_date) <= new Date(startDate) &&
   219→        (!m.end_date || new Date(m.end_date) > new Date(startDate))
   220→      ).length || 0;
   221→
   222→      const churned = memberships?.filter(m =>
   223→        m.cancelled_at &&
   224→        new Date(m.cancelled_at) >= new Date(startDate) &&
   225→        new Date(m.cancelled_at) <= new Date(endDate)
   226→      ) || [];
   227→
   228→      const churnRate = activeAtStart > 0 ? (churned.length / activeAtStart) * 100 : 0;
   229→
   230→      // Analyze churn reasons
   231→      const reasonCounts = new Map<string, number>();
   232→      churned.forEach(m => {
   233→        const reason = m.cancellation_reason || 'No reason provided';
   234→        reasonCounts.set(reason, (reasonCounts.get(reason) || 0) + 1);
   235→      });
   236→
   237→      // Monthly breakdown
   238→      const monthlyChurn = new Map<string, { churned: number; active: number }>();
   239→      churned.forEach(m => {
   240→        if (m.cancelled_at) {
   241→          const month = new Date(m.cancelled_at).toISOString().substring(0, 7);
   242→          const existing = monthlyChurn.get(month) || { churned: 0, active: activeAtStart };
   243→          existing.churned++;
   244→          monthlyChurn.set(month, existing);
   245→        }
   246→      });
   247→
   248→      return {
   249→        success: true,
   250→        data: {
   251→          churnRate,
   252→          activeAtStart,
   253→          churnedCount: churned.length,
   254→          retentionRate: 100 - churnRate,
   255→          churnReasons: Object.fromEntries(reasonCounts),
   256→          monthlyBreakdown: Array.from(monthlyChurn.entries()).map(([month, data]) => ({
   257→            month,
   258→            churned: data.churned,
   259→            churnRate: (data.churned / data.active) * 100,
   260→          })),
   261→          churned: churned.map(m => ({
   262→            clientId: m.client_id,
   263→            plan: (m.membership_plans as any)?.name,
   264→            category: (m.membership_plans as any)?.category,
   265→            cancelledAt: m.cancelled_at,
   266→            reason: m.cancellation_reason,
   267→          })),
   268→        },
   269→        metadata: {
   270→          recordsAffected: memberships?.length || 0,
   271→          executionTimeMs: Date.now() - startTime,
   272→        },
   273→      };
   274→    } catch (error) {
   275→      return {
   276→        success: false,
   277→        error: error instanceof Error ? error.message : 'Failed to generate churn report',
   278→      };
   279→    }
   280→  }
   281→}
